import { render } from "@testing-library/react"
import ReactDOM from "react-dom";
import "./style.css";
ReactDOM.render(
   <div className="main">
       <div className="header">Справочник</div>
       <div className="blocks">
               <Block react="React" reacttext="React - самая популярная JavaScript-библиотека. Ежедневно ее загружают миллионы раз"> </Block>
       </div>
   </div>,
    document.getElementById("root")
    );
